import React from 'react';
import TextField from '@material-ui/core/TextField';
import styles from './sign-in.module.css'

// import FormInput from '../form-input/form-input.component';
// import CustomButton from '../custom-button/custom-button.component';

import './sign-in.styles.scss';

class SignIn extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      email: '',
      password: ''
    };
  }

  handleSubmit = event => {
    event.preventDefault();

    this.setState({ email: '', password: '' });
  };

  handleChange = event => {
    const { value, name } = event.target;

    this.setState({ [name]: value });
  };

  render() {
    return (

      <div className={styles.Contaner} >
            <p>If not having account.Create account here</p>
            <form className={styles.from_container} >
            <div className= {styles.text_field} >
            <TextField className= {styles.text_field}  required id="standard-required" label="Name"  />    
            </div>
            <div className= {styles.text_field} >
            <TextField className= {styles.text_field}  required id="standard-required" label="Email"  type="email"  />
            </div>
            <div className= {styles.text_field} >
            <TextField
                className= {styles.text_field}
                id="standard-password-input"
                label="Password"
                type="password"
                autoComplete="current-password"
            />
            </div>
            <div className= {styles.text_field} >
            <TextField
                className= {styles.text_field}
                id="standard-password-input"
                label="Confirm Password"
                type="confirm password"
                autoComplete="current-password"
            />
            </div>
            
            
            
            
            
        </form>
        </div>
          );
  }
}

export default SignIn;
